ALTER DATABASE Arosaje_db CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;

Use Arosaje_db;

CREATE TABLE Role(
   id_role INT NOT NULL AUTO_INCREMENT,
   description VARCHAR(550),
   PRIMARY KEY(id_role)
);

CREATE TABLE Person(
   id_person INT NOT NULL AUTO_INCREMENT,
   name VARCHAR(50),
   firstname VARCHAR(50),
   pwd VARCHAR(256),
   email VARCHAR(50),
   phone VARCHAR(20),
   latitude DOUBLE,
   longitude DOUBLE,
   id_role INT NOT NULL,
   last_login DATETIME DEFAULT CURRENT_TIMESTAMP,
   PRIMARY KEY(id_person),
   UNIQUE(email),
   FOREIGN KEY(id_role) REFERENCES Role(id_role)
);

CREATE TABLE Plante(
   id_plante INT NOT NULL AUTO_INCREMENT,
   name VARCHAR(50),
   number INT,
   road_first VARCHAR(200),
   road_second VARCHAR(200),
   town VARCHAR(100),
   postal_code INT,
   latitude DOUBLE,
   longitude DOUBLE,
   id_person INT NOT NULL,
   PRIMARY KEY(id_plante),
   FOREIGN KEY(id_person) REFERENCES Person(id_person)
);

CREATE TABLE Garde(
   id_garde INT NOT NULL AUTO_INCREMENT,
   begining DATETIME,
   finish DATETIME,
   id_person INT ,
   id_plante INT NOT NULL,
   PRIMARY KEY(id_garde),
   FOREIGN KEY(id_plante) REFERENCES Plante(id_plante)
);

CREATE TABLE Photo(
   id_photo INT NOT NULL AUTO_INCREMENT,
   advice_title VARCHAR(150),
   advice VARCHAR(550),
   image_data LONGTEXT,
   id_plante INT NOT NULL,
   PRIMARY KEY(id_photo),
   FOREIGN KEY(id_plante) REFERENCES Plante(id_plante)
);

CREATE TABLE Chat(
   id_message INT NOT NULL AUTO_INCREMENT,
   date_message DATETIME,
   message VARCHAR(550),
   id_person INT NOT NULL,
   PRIMARY KEY(id_message),
   FOREIGN KEY (id_person) REFERENCES Person(id_person)
);

CREATE TABLE Message(
   id_message INT NOT NULL AUTO_INCREMENT,
   date_message DATETIME,
   message VARCHAR(550),
   id_emetteur INT NOT NULL,
   id_receveur INT NOT NULL,
   PRIMARY KEY(id_message),
   FOREIGN KEY (id_emetteur) REFERENCES Person(id_person),
   FOREIGN KEY (id_receveur) REFERENCES Person(id_person)
);

